import {AppBar, Button, Grid, IconButton, Toolbar, Typography} from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';
import React, {FunctionComponent} from 'react';
import './header.css';
import LogoImg from './assets/logo.png'

const Header: FunctionComponent = ()=>{
    const handleGotoSection = () => {
        window.scrollTo({
            top: 500 ,
            behavior: 'smooth'
        })
    }

    return (
        <Grid className="headerContainer">
            <AppBar position="static">
                <Toolbar>
                    <IconButton edge="start" className="menuButton"  aria-label="menu">
                        <MenuIcon />
                    </IconButton>
                    <img src={LogoImg} className="logoImg" alt={"Logo image"} />

                    <Button color="inherit" section-id={1} onClick={handleGotoSection}>About</Button>
                    <Button color="inherit">Get Solana Chan</Button>
                    <Button color="inherit">Connect Wallet</Button>
                    <Button color="inherit">Login</Button>
                    <Button color="inherit">Login</Button>
                </Toolbar>
            </AppBar>
        </Grid>
    );
}

export default Header;
